import React, { Component } from 'react';
import { setItem, setDate, getBill } from "../store/actions";

class WaterTemplate extends Component {
    state = {  }
    render() { 
        return (<div>water</div>  );
    }
}
 
 const mapStateToProps = ({
    SetItemReducer,
    SetDateReducer,
    GetBillReducer,
  }) => {
    return {
      newItem: SetItemReducer.data.item,
      dateRange: SetDateReducer.data,
      billData: GetBillReducer,
    };
  };
  export default connect(mapStateToProps, {
    setItem,
    setDate,
    getBill,
  })(WaterTemplate);
